import React, { useEffect, useState } from "react";
import Backendless from 'backendless'


//console.log( "--> Aca esta Diego!")


export function Page1() {

    var APP_ID = 'F405D13E-0A77-400C-ACBE-8146E8285936';
    var API_KEY = 'BC70880E-34E2-4992-AB6C-C87592ED3A5B';
    Backendless.initApp(APP_ID, API_KEY);

    const [texto, setTexto] = useState("Cargando...");
    
    useEffect(() => {
        Backendless.Data.of("Person").findFirst()
            .then(result => {
                const resultString = JSON.stringify(result, null, 2);
                setTexto(resultString);
                console.log("Resultado de Find:", resultString);
            })
            .catch(error => {
                console.error("Error:", error.message);
                setTexto("Error al obtener datos");
            });
    }, []); // [] asegura que esto solo se ejecute una vez

