            //const resultString = JSON.stringify(result);
            texto = JSON.stringify(result);
            console.log( "Resultado de Find: " + texto)
        })
        .catch( function( error ) {
        console.log( "error - " + error.message );
        });
    */
    
    /*
    const result = await Backendless.Data.of('Person').findFirst();
    const texto = JSON.stringify(result);
    console.log( "Resultado de busqueda: " + texto)
    */
    
