    const query = Backendless.DataQueryBuilder.create()  
    query.addProperty('name')  
    query.setDistinct(true)  
    const result = await Backendless.Data.of('Person').find(query)
    console.log( "Resultados: " + result)
    */

    //const texto = "Hellos";

    return (
        <>
            <h4>Page1 - Backendless</h4>
            <pre>{texto}</pre>
        </>
    )
}
